    }
    if (uniffi_walletkit_checksum_constructor_alloyclient_new_trezor() != 7789) {
        return InitializationResult.apiChecksumMismatch
    }
    if (uniffi_walletkit_checksum_constructor_alloyclient_new_watch_only() != 54464) {
